library BoilerplateParam {
    struct ParamTemplate {
        // 1: int
        // 2: float
        // 3: string
        // 4: bool
        uint8 _typeValue;

        uint256 _max;
        uint256 _min;
        uint8 _decimal;
        string[] _availableValues;
        uint256 _value;// index of available array value or value of range min,max
